	public static void createAccount(AccountDto accountDto, File file) {
		Client client = null;
		try {

			if (accountDto == null || file == null)
				return;
			String consumerRole = null;
			if (accountDto.getConsumerRole() != null) {
				consumerRole = accountDto.getConsumerRole().replaceAll(" ", "%20");
			}
			String enterpriseRole = accountDto.getEnterpriseRole() != null
					? accountDto.getEnterpriseRole().replaceAll(" ", "%20")
					: null;
			String language = accountDto.getLanguage() != null ? accountDto.getLanguage().replaceAll(" ", "%20") : null;
			String name = accountDto.getName() != null ? accountDto.getName().replaceAll(" ", "%20") : null;

			String API_URI = "http://localhost:8081/account/CreateAccount?consumerRole=" + consumerRole + "&name="
					+ name + "&enterpriseRole=" + enterpriseRole + "&language=" + language;

			ClientConfig config = new DefaultClientConfig();
			client = Client.create(config);
			WebResource resource = client.resource(API_URI);

			FileDataBodyPart fileDataBodyPart = new FileDataBodyPart("file", file,
					MediaType.APPLICATION_OCTET_STREAM_TYPE);
			fileDataBodyPart
					.setContentDisposition(FormDataContentDisposition.name("file").fileName(file.getName()).build());

			MultiPart multiPart = new FormDataMultiPart()
					// .field("consumerRole", consumerRole, MediaType.TEXT_PLAIN_TYPE)
					// .field("name", name, MediaType.TEXT_PLAIN_TYPE)
					// .field("enterpriseRole", enterpriseRole, MediaType.TEXT_PLAIN_TYPE)
					// .field("language", language, MediaType.TEXT_PLAIN_TYPE)
					.bodyPart(fileDataBodyPart);
			multiPart.setMediaType(MediaType.MULTIPART_FORM_DATA_TYPE);

			ClientResponse response = resource.type("multipart/form-data").post(ClientResponse.class, multiPart);

			String output = null;
			while (response.getStatus() == 200) {
				output = response.getEntity(String.class);
			}
			System.out.println("INFO >>> Response from API was: " + output);
		} catch (Exception exp) {

		} finally {
			client.destroy();
		}

	}

